export function fetchKlasses() {
  return (dispatch) => {
    dispatch({type: 'START_ADDING_KLASSES_REQUEST'})
    fetch(`/klasses`)
      .then(resp => resp.json())
      .then(json => {
        console.log(json)
        return dispatch({ type: 'ADD_KLASSES', json })
      })
  }
}
